Northwind.Common.Components.Grid.PageView=Ember.View.extend({classNames:["pull-left","table-page"],defaultTemplate:Ember.Handlebars.compile("Showing {{view.first}} - {{view.last}} from {{filteredContent.length}}"),didPageChange:function(){var a=this.get("controller.page"),b=this.get("controller.limit"),c=this.get("controller.filteredContent.length");this.set("first",a*b+1),this.set("last",Math.min(c,a*b+b))}.observes("controller.page","controller.filteredContent.length")})